import React from "react";
import CreateUserContainer from "./CreateUserContainer";
import LoginContainer from "./LoginContainer";
import MoviesContainer from "./MoviesContainer";
import SingleMovieContainer from "./SingleMovieContainer";
import Footer from "./FooterContainer";
import NavBar from "./NavBarContainer";
import { Link, Switch, Route } from "react-router-dom";

export default () => {
  return (
    <div>
      <Footer />
      <Switch>
        <Route path="/createuser" render={() => <CreateUserContainer />} />
        <Route path="/login" render={() => <LoginContainer />} />
        <Route path="/movies/:id" render={ ({match})  => <SingleMovieContainer match={match.params} />} />
        <Route exact path="/movies" render={() => <MoviesContainer />} />
      </Switch>
      <LoginContainer />
      <NavBar />
    </div>
  );
};
